import React from 'react';
import logo1 from './logo_oficial.png'; // relative path to image 
import './App.css';
import Card from './componentes/Card';
import Boton from './componentes/BtnLink';
import MyParallax from './parallax';
import MyParallax2 from './SecondParallax';
import Categoria from './componentes/Categoria';
import Form from './componentes/form';
import Footer from './componentes/Footer';
import {BrowserRouter as Router, Route, Link, Switch} from'react-router-dom';
import Login from './componentes/login';

function App() {
  return (
    <>
    <div className="App">
      <div className="nav"> 
        <div className="log">
          <a href="...">
            <img src={logo1} className="logo" alt="logo" width="45px" height="45px" />
            lue Shopping
          </a>
        </div>
        <div className="btns">
          <Router>
            <ul className="nav-container list">
               <li><Link to="" className="">Tienda</Link></li>
               <li><Link to="" className="">Registrate</Link></li>
               <li><Link to="" className="">Iniciar sesion</Link></li>
             </ul>
             <Switch>
               <Route exact path="./componentes/login" component={Login}/>
             </Switch> 
          </Router>
        </div>
      </div>
      <div className="parallax">
         <MyParallax />
      </div>
      <div className="card">
        <Card />
      </div> 
      <MyParallax2 />

      <Categoria />

      <Form /> 

      <Footer />   
    </div>
    </>
  );
}
export default App;
